import React from 'react';
import { BrowserRouter, Route, Link } from 'react-router-dom';
import Page_O from './pageOleada';

const App = () => {
  return (
    <BrowserRouter>
      <div>
        <nav>
            <Link to="/Page_O">Page oleada</Link>
        </nav>
        <Route path="/Page_O" exact component={Page_O} />
        Hello
      </div>
    </BrowserRouter>
  );
};

export default App;
